The latest campaign of @MalabarGoldandDiamonds is perfect treat for all Indian brides-to-be out there. @KareenaKapoor and @AnilKapoor have presented brands bridal collection which the brand offers through their song MakeWayForTheBride. The song showcases unique bridal entries of different Indian brides. 

P.S: So brides-to-be you can not only take cues for hatke bridal entry but also add an exquisite jewellery from the Malabar Gold & Diamonds latest bridal jewellery collection to your trousseau.
